hi,

for the 3rd Question, why this cant be the solution

select games,count(distinct(noc))  from OLYMPICS_HISTORY oh group by games order by games;

In PostgreSQL you can get using below query:
select (current_date - 1) as yesterday_date; 

In Oracle, it can be as below:
select (sysdate - 1) as yesterday_date from dual;

If any other database then you need to find the corresponding function for sysdate/current_date and write similar query.
